import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from "./component/Login";
import Cartlist from "./component/Cartlist";

function App() {
  return ( 
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/list" element={<Cartlist />} />
      </Routes>
    </BrowserRouter>
  )
}

export default App;
